records:
type PrefixItem record {
	int|string ItemCode;
};

type PrefixOtherItem record {
	string ItemCode;
};

type PrefixCodes record {
	PrefixItem|decimal|int|string[] item;
	PrefixOtherItem otherItem;
};

type Bookstore record {
	string storeName;
	int postalCode;
	boolean isOpen;
	PrefixCodes codes;
	string status;
};
